import React, { useEffect, useState } from 'react';
import axios from 'axios';
function Sessions({ sessionSelection, toggleSlider, name }) {
    return (
        <div className="border rounded-xl text-sm mt-10 mx-5">
            {/* Other code remains the same */}
            {name.map((session) => (
                <div key={session._id} className="grid grid-cols-3 px-5 py-3 items-center border-b">
                    <div className="flex items-center space-x-3">
                        <div className={`w-8 h-8 rounded-full flex items-center justify-center ${session.type === "FND" ? "bg-gray-400" : "bg-green-500"} text-white`}>
                            {session.type}
                        </div>
                        <span>{session.session_name}</span>
                    </div>
                    <div>
                        <span
                            className={`px-4 py-1 rounded-lg ${session.entries[session.entries.length - 1].score >= 8
                                ? 'bg-green-100 text-green-600'
                                : session.entries[session.entries.length - 1].score >= 6
                                    ? 'bg-yellow-100 text-yellow-600'
                                    : 'bg-red-100 text-red-600'
                                }`}
                        >
                            {session.entries[session.entries.length - 1].score}
                        </span>
                    </div>

                    <div className="flex items-center justify-between">
                        <span>{session.entries[session.entries.length - 1].last_session}</span>
                        <div onClick={() => { sessionSelection(session.session_name); toggleSlider(); }} className="flex space-x-2">
                            <button className="text-blue-400 font-semibold border-l-2 px-5">View details</button>
                        </div>
                    </div>
                </div>
            ))}
        </div>
    );
}

export default Sessions;
